import NavBar from "./NavBar";
import Pagelayout from "./Pagelayout";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Switch>
          <Route path="/">
            <Pagelayout />
          </Route>
          <Route path="/:{id}"></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
